import { Route } from "react-router-dom";
import AllMettUps from "./pages/AllMeetUps";
import Favourites from "./pages/Favourites";
import NewMeetUp from "./pages/NewMeetUp";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/">
          <AllMettUps />
        </Route>
        <Route path="/new-meetups">
          <NewMeetUp />
        </Route>
        <Route path="/favourites">
          <Favourites />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
